export default function McRide(): JSX.Element {
	return (
		<img
			src="https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.shitpostbot.com%2Fimg%2Fsourceimages%2Fmc-ride-transparent-57bfac9b47527.png"
			width="1000"
			height="800"
			alt="Mc Ride pointing at you"
		/>
	)
}
